The Sci Fi Original 3 Part Made For T.V. Movie.

All 3 DVD Disc Rips.

Dorothy Gale, a.k.a. DG, is all grown up and bored. She mopes around, works as a waitress, and goes to school part time. Before she knows it she's back in OZ (a.k.a. Outer Zone) and on the run from the evil sorceress Azkadellia and her storm troopers and clumsy bats. Along the way she falls in with some strange characters including the brainless Glitch, Raw, a cowardly and psychic lion-man hybrid, and, in the largest deviation, Wyatt Cain, a cowboy cop from Central City called a &quot;tin man&quot; because of his tin badge.
